import axios from 'axios'
import serverRoute from './server-route'

export const login = ({ username, password }) => {
    return axios.post(serverRoute + "/login", {
        username,
        password
    })
}

export const logout = () => {
    return axios.delete(serverRoute + "/logout")
}
